    width: 1230px;
    height: 900px;

    position: absolute;
    left: 218px;
  `;
  const TopBar = styled.div`
    display: flex;
    flex-direction: row;
    width: 100%;
    height: 43px;
  `;

  // functionality
  // const [searchText, setSearchText] = useState<string>("Поиск клиента");
